import React from "react";

const Card = ({cardValue}) => {
  return (
    <div className="card" key={cardV}>
      <div className="card-body">
        <h5 className="card-title">{cardValue.title}</h5>
        <p className="card-text">(0 of 3) SubTasks</p>
      </div>
    </div>
  );
};

export default Card;
